import KanbasNavigation from "./KanbasNavigation";
import React from "react";
import './index.css'

function Kanbas() {
  return (
    <div className="d-flex">
      <KanbasNavigation />
      <div>
        <h1>Account</h1>
        <h1>Dashboard</h1>
        <h1>Courses</h1>
      </div>
    </div>
  );
}
export default Kanbas;
